Custom gestures
==============================

Gesture object
--------------------
The object structure of a gesture:

{ name: 'mygesture',
  index: 1337,
  defaults: {
    mygesture_option: true
  }
  handler: function(type, ev, inst) {
    // trigger gesture event
    inst.trigger(this.name, ev);
  }
}

